import React, { Component } from 'react';
import logo from './gremlin-neptune.png';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import './App.css';

const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
  dense: {
    marginTop: 19,
  },
  menu: {
    width: 200,
  },
});

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Welcome to AWS re:Invent 2018 Workshop: <br/>
            DAT310 - Building a New Graph Application Using Amazon Neptune.
          </p>
        </header>
        <p>
          <TextField
            id="standard-full-width"
            label="Enter Gremlin Traversal:"
            style={{ margin: 8, width: 600 }}
            placeholder="<Insert Traversal Here>"
            helperText="Ex: g.V().hasLabel('movie').limit(5)"
            margin="normal"
            InputLabelProps={{
              shrink: true,
            }}
          />
          <Button size="medium">
            Go!
          </Button>
        </p>
      </div>
    );
  }
}

export default App;
